import React,{Component} from "react";
import '../css/Monetize.css'

class Monetize extends Component{
    render(){
        return (
            <div>
                <p id="monetize-head"><b></b>Monetize Your Opinions</p>
            </div>
        );
    }
}

export default Monetize;
